import React from 'react';
import Signin from './components/Signin';
import Signup from './components/Signup';
import BlogPostForm from './components/BlogPostForm';
import PostList from './components/PostList';

function App() {
    return (
        <div>
            <Signin />
            <Signup />
            <BlogPostForm />
            <PostList />
        </div>
    );
}

export default App;
